import React from "react";

export const Pokemons = ({ locationUrl }) => {
  
    use
    const fetchData = async () => {
    try {
      const response = await fetch(locationUrl);
      const data = await response.json();
      console.log(data);
    } catch (err) {
      console.log(err);
    }
  };
  return <div url={fetchData}>test</div>;
};
